Description: A faded television actor and his stunt double strive to achieve fame and success in the final years of Hollywood's Golden Age in 1969 Los Angeles.

The Good:
- Leonardo DiCaprio And Brad Pitt
- It's Full Of Classic Hollywood Refrences
- The Ridiculously Stacked Ensemble Cast
- It Looks And Sounds Fantastic
- The Absolutely Insane Ending
The Bad:
- The Uneven, Self-Indulgent Pacing
- Margot Robbie Is Wasted
- Way Too Much Feet,C'mon Quentin, Stop It

Conclusion: Fans of the filmmaker who suitably temper their expectations are sure not to be disappointed: this isn't one of Tarantino's strongest efforts as a writer-director and it's likely to end up one of his more generally polarising films, but given the high standard he's held to, this is still a great movie.

